    NonProductiveOperationComponent.prototype.getLength = function (str) {
        var realLength = 0, len = str.length, charCode = -1;
        for (var i = 0; i < str.length; i++) {
            charCode = str.charCodeAt(i);
            if (charCode >= 0 && charCode <= 128) {
                realLength += 1;
            }
            else {
                realLength += 3;
            }
        }
        return realLength;
    };
