    //修改理财风险评估
    ProductiveOperationComponent.prototype.updateRiskBasicInfo = function (data) {
        var _this = this;
        if (data == 1) {
            this.isRiskBasicEdit = false;
            this.riskCLick = false;
        }
        else if (data == 2) {
            // 第一次点击
            if (this.riskCLick) {
                this.msgs = [];
                this.msgs = [{ severity: 'error', summary: '提示', detail: '正在保存，请勿频繁操作！' }];
                return;
            }
            if (!this.riskBasicBean.riskAsseType || this.riskBasicBean.riskAsseType == null || this.riskBasicBean.riskAsseType == '') {
                this.msgs = [{ severity: 'error', summary: '提示', detail: '理财风险评估类型不能为空' }];
                return;
            }
            // if (!this.riskBasicBean.riskAsseDate || this.riskBasicBean.riskAsseDate == null || this.riskBasicBean.riskAsseDate == '') {
            //   this.msgs = [{ severity: 'error', summary: '提示', detail: '风险评估日期不能为空' }];
            //   return;
            // }
            // if (!this.riskBasicBean.effDate || this.riskBasicBean.effDate == null || this.riskBasicBean.effDate == '') {
            //   this.msgs = [{ severity: 'error', summary: '提示', detail: '评估失效日期不能为空' }];
            //   return;
            // }
            // if (!this.riskBasicBean.evalCustMgr || this.riskBasicBean.evalCustMgr == null || this.riskBasicBean.evalCustMgr == '') {
            //   this.msgs = [{ severity: 'error', summary: '提示', detail: '评估人不能为空' }];
            //   return;
            // }
            // if (!this.riskBasicBean.evalOrg || this.riskBasicBean.evalOrg == null || this.riskBasicBean.evalOrg == '') {
            //   this.msgs = [{ severity: 'error', summary: '提示', detail: '评估人所在机构不能为空' }];
            //   return;
            // }
            this.showSave2 = true;
            this.riskBasicBean.custNo = this.custNo;
            var param = lodash__WEBPACK_IMPORTED_MODULE_4__["clone"](this.riskBasicBean);
            param.riskAsseDate = this.commfunc.transDate(param.riskAsseDate);
            param.effDate = this.commfunc.transDate(param.effDate);
            this.riskCLick = true;
            this.httpService.addRiskAsseInfo(param).subscribe(function (data) {
                if (data.returnCode.code == 'success') {
                    _this.httpService.selectRiskAsseInfo({ custNo: _this.custNo }).subscribe(function (data) {
                        if (data.returnCode.code == 'success') {
                            _this.msgs = [{ severity: 'success', summary: '提示', detail: data.returnCode.message }];
                            if (data.riskAsseDate == null) {
                                data.riskAsseDate = null;
                            }
                            else {
                                data.riskAsseDate = new Date(data.riskAsseDate);
                            }
                            if (data.effDate == null) {
                                data.effDate = null;
                            }
                            else {
                                data.effDate = new Date(data.effDate);
                            }
                            _this.riskBasicBean = data;
                            _this.isRiskBasicEdit = true;
                        }
                    });
                }
                _this.showSave2 = false;
                _this.riskCLick = false;
            });
        }
        else if (data == 3) {
            this.riskCLick = false;
            this.httpService.selectRiskAsseInfo({ custNo: this.custNo }).subscribe(function (data) {
                if (data.returnCode.code == 'success') {
                    if (data.riskAsseDate == null) {
                        data.riskAsseDate = null;
                    }
                    else {
                        data.riskAsseDate = new Date(data.riskAsseDate);
                    }
                    if (data.effDate == null) {
                        data.effDate = null;
                    }
                    else {
                        data.effDate = new Date(data.effDate);
                    }
                    _this.riskBasicBean = data;
                    _this.isRiskBasicEdit = true;
                }
            });
        }
    };
